import React from "react";
import logo from "../img/logo.svg";
import sidbarMenu from "../ultis/menu";
import { NavLink } from "react-router-dom";



const activeStyle = 'py-2 px-[25px] flex items-center gap-2 font-semibold text-white no-underline bg-slate-500 ';
const notActiveStyle = 'py-2 px-[25px] flex items-center gap-2 font-semibold text-[#c7c6c6] no-underline hover:text-white'
const SidebarLeft = () => {


  return (
    <div className="bg-slate-700  flex flex-col bg-">
      <div className="w-full h-[70px] px-[25px] flex justify-start items-center">
        <img src={logo} className="w-[120px]  object-content" alt="logo" />
      </div>
      <div>
        {sidbarMenu.map((item) => (
          <NavLink
            to={item.path}
            className={({isActive}) => isActive ? activeStyle : notActiveStyle}
          >
            <span className="h-[24px] w-[24px]">{item.icons}</span>
            <span className="font-medium text-sm">{item.test}</span>
          </NavLink>
        ))}
      </div>
    </div>
  );
};

export default SidebarLeft;
